var showTeamMemberInfo=()=>{if(window.innerWidth>768){let e=document.querySelectorAll('[data-trigger="collapse"]');for(let t=0;t<e.length;t++)e[t].addEventListener("mouseover",(()=>{checkState(e[t])}));for(let t=0;t<e.length;t++)e[t].addEventListener("mouseout",(()=>{checkState(e[t])}))}};function checkState(e){e.parentElement.querySelectorAll("[data-state]").forEach((e=>{"collapsed"===e.getAttribute("data-state")?expandElement(e):collapseElement(e)}))}function collapseElement(e){e.animate([{height:`${e.scrollHeight}px`},{height:0}],{duration:400,easing:"ease"}),e.setAttribute("data-state","collapsed")}function expandElement(e){e.animate([{height:0},{height:`${e.scrollHeight}px`}],{duration:400,easing:"ease"}),e.setAttribute("data-state","expanded")}window.addEventListener("load",(()=>{preloader(),setHeight(),showTeamMemberInfo();let e=Math.max(BODY.scrollHeight,BODY.offsetHeight,HTML.clientHeight,HTML.scrollHeight,HTML.offsetHeight);sessionStorage.setItem("heightPage",e),initWhatsAppBtn()}));